script: |
  super -f tsv -I q8553.sql | sort > q8553.out

vector: true

inputs:
  - name: q8553.sql
    data: |
      SELECT DISTINCT 20 + - 53 * - col0 AS col1 FROM tab2 WHERE NOT col1 / - ( + - col0 ) IN ( + col0, + CAST ( + col2 AS INTEGER ), + col1, col1, - col1, col0 + + - col1, - col0 ) GROUP BY col0 HAVING NOT 10 IS NULL;
  - name: tab2

outputs:
  - name: q8553.out
    data: |
      4843
      4896
      815
